wikipedia_content:
The word catholic (derived via Late Latin catholicus, from the Greek adjective  katholikos 'universal') comes from the Greek phrase  katholou 'on the whole, according to the whole, in general', and is a combination of the Greek words  'about' and  'whole'. The first use of "Catholic" was by the church father Saint Ignatius of Antioch in his Letter to the Smyrnaeans (circa 110 AD). In the context of Christian ecclesiology, it has a rich history and several usages. 

The word in English can mean either "of the Catholic faith" or "relating to the historic doctrine and practice of the Western Church". "Catholicos", the title used for the head of some churches in Eastern Christian traditions, is derived from the same linguistic origin.

In non-ecclesiastical use, it derives its English meaning directly from its root, and is currently used to mean the following: 
 including a wide variety of things, or all-embracing;
 universal or of general interest;
 having broad interests, or wide sympathies;
 inclusive, inviting.

The term has been incorporated into the name of the largest Christian communion, the Roman Catholic Church

